%[text] ## 1. a. Laplace Transform
syms t s
f_t = 5*exp(6*t)*sin(8*t) - t^2*exp(-6*t);

F_s = laplace(f_t, t, s);
disp(F_s); %[output:9a3a8b52]
%[text] ## 1. b. Steady State Value
s = tf('s');

numerator = 15*s^2 + 204*s + 476;
denominator = (s^2 - 12*s + 100) * (s + 6)^2;
G = numerator / denominator;

input_amplitude = 900;

poles = pole(G);
disp('System Poles:'); %[output:61d5ed6c]
disp(poles); %[output:6a8d031e]

is_stable = all(real(poles) < 0);

if is_stable %[output:group:597a4be9]
    dc_gain = dcgain(G);
    steady_state_val = input_amplitude * dc_gain;
    fprintf('System is STABLE. Steady State Value = %.4f\n', steady_state_val);
else
    fprintf('System is UNSTABLE (Positive real poles found).\n'); %[output:8c7a84ab]
    fprintf('The output will be Unbounded (Infinity).\n'); %[output:5fe4fbc5]
end %[output:group:597a4be9]
%[text] ## 1. c. Partial Fractions
clear 
syms s t C(s)
C(s)=900*(15*s^2+204*s+476)/(s*(s^2-12*s+100)*(s+6)^2) %[output:610cb746]
% Perform partial fraction decomposition
result = partfrac(C(s));
disp(result); %[output:89a9bebc]
%[text] ## **1. d. Time Domain Output/Inverse Laplace**
disp(ilaplace(result)); %[output:22919904]
%[text] ## **1. e. Estimate values of K and alpha**
load('labDataMidterm23.mat');
y_ss = mean(omega_measured(end-10:end)); 

target_value = 0.632 * y_ss;

[~, idx] = min(abs(omega_measured - target_value));

tau = t(idx);

alpha = 1 / tau;

K = y_ss * alpha;

% --- Display Results ---
fprintf('Estimated Steady State (y_ss): %.4f rad/s\n', y_ss); %[output:88f2a631]
fprintf('Estimated Time Constant (tau): %.4f s\n', tau); %[output:267b8b74]
% alpha = 0.5128 == 0.5
fprintf('Calculated Alpha: %.4f\n', alpha);  %[output:0a517c05]
% K = 2.0593 == 2
fprintf('Calculated K: %.4f\n', K); %[output:22d391e5]
%[text] ## **1. f. Approximate Transfer Function**
% Given in the question
load("labDataMidterm23.mat")
plot(t,omega_measured) %[output:41258b50]
xlabel('Time $t$ (s)','Interpreter',"latex") %[output:41258b50]
ylabel('$\omega$ (rad/s)',"Interpreter","latex") %[output:41258b50]
title("Angular Velocity ($\omega$) vs Time ($t$) for 1V step input","Interpreter","latex") %[output:41258b50]
grid %[output:41258b50]
% Solution

load('labDataMidterm23.mat')

% Create an iddata object.
% Input is a Step (1V) vector of the same length as time 't'
u = ones(size(t)); 
Ts = mean(diff(t)); % Calculate sampling time
data = iddata(omega_measured, u, Ts); % omega_measured found from MATLAB data file

% Estimate transfer function with 1 pole and 0 zeros
sys_est = tfest(data, 1, 0); %[output:517d303d]
figure; %[output:1ad9168e]
% Plot the original measured data
plot(t, omega_measured, 'y-', 'LineWidth', 2,'MarkerSize', 8, 'DisplayName', 'Measured Data');  %[output:1ad9168e]
hold on; %[output:1ad9168e]

% Plot the Model Response
% We use 'step' command but define time 't' to match the data range
[y_model, t_model] = step(sys_est, t); 
plot(t_model, y_model, 'r-', 'LineWidth', 2, 'DisplayName', 'Fitted Model (tfest)'); %[output:1ad9168e]

% Formatting
xlabel('Time $t$ (s)','Interpreter',"latex") %[output:1ad9168e]
ylabel('$\omega$ (rad/s)',"Interpreter","latex") %[output:1ad9168e]
title("Model Verification: Measured vs Fitted","Interpreter","latex") %[output:1ad9168e]
legend('show', 'Location', 'SouthEast'); %[output:1ad9168e]
grid on; %[output:1ad9168e]
hold off; %[output:1ad9168e]

% Display the estimated transfer function in Command Window
sys_est %[output:6a29eaa3] %[output:9b06fbce]

